INSERT INTO `announcements` (`id`, `status`, `title`, `content`, `date`, `created_at`, `updated_at`) VALUES
(151, 'published', 'Jam Besuk Warga Binaan Lapas Jombang', 'Diberitahukan kepada keluarga warga binaan bahwa jam besuk di Lapas Kelas IIB Jombang dilaksanakan setiap hari SeninKamis pukul 09.0012.00 WIB sesuai dengan ketentuan yang berlaku.', '2026-02-12', '2026-02-12 04:38:04', '2026-02-12 04:38:04'),
(152, 'published', 'Program Pembinaan Kemandirian', 'Lapas Kelas IIB Jombang terus meningkatkan program pembinaan kemandirian melalui pelatihan keterampilan seperti kerajinan tangan dan pertanian bagi warga binaan.', '2026-02-10', '2026-02-12 04:38:04', '2026-02-12 04:38:04'),
(153, 'published', 'Layanan Kunjungan Online', 'Untuk meningkatkan pelayanan, Lapas Jombang menyediakan layanan pendaftaran kunjungan secara online melalui website resmi guna memudahkan masyarakat.', '2026-02-08', '2026-02-12 04:38:04', '2026-02-12 04:38:04'),
(154, 'draft', 'Sosialisasi Tata Tertib Baru', 'Akan dilaksanakan sosialisasi terkait pembaruan tata tertib bagi warga binaan dan pengunjung demi menjaga keamanan dan ketertiban di lingkungan lapas.', '2026-02-15', '2026-02-12 04:38:04', '2026-02-12 04:38:04'),
(155, 'published', 'Peringatan Hari Besar Nasional', 'Dalam rangka memperingati hari besar nasional, Lapas Kelas IIB Jombang mengadakan kegiatan upacara dan pembinaan karakter bagi seluruh warga binaan.', '2026-02-01', '2026-02-12 04:38:04', '2026-02-12 04:38:04');
