(153, 'published', 'Pendirian Pesantren di Dalam Lapas Kelas IIB Jombang, Ratusan Warga Binaan Jadi Santri', 'pendirian-pesantren-di-dalam-lapas-kelas-iib-jombang-ratusan-warga-binaan-jadi-santri', '<div><strong>SURYA.CO.ID, JOMBANG</strong> - Upaya pembinaan spiritual bagi warga binaan Lembaga Pemasyarakatan (Lapas) Kelas IIB <a href=\"https://surabaya.tribunnews.com/tag/jombang\">Jombang</a>, Jawa Timur (Jatim), kini memasuki babak baru.&nbsp;</div><div>Jumat (12/9/2025), <a href=\"https://surabaya.tribunnews.com/tag/pesantren-al-muhajirin\">Pesantren Al Muhajirin</a> diresmikan sebagai wadah pendidikan agama bagi sekitar 700 warga binaan <a href=\"https://surabaya.tribunnews.com/tag/lapas-kelas-iib-jombang\">Lapas Kelas IIB Jombang</a>.</div><div>Peresmian dilakukan langsung oleh Kepala Kantor Wilayah (Kakanwil) Direktorat Jenderal Pemasyarakatan (Ditjenpas) Jawa Timur, <a href=\"https://surabaya.tribunnews.com/tag/kadiyono\">Kadiyono</a>, bersama <a href=\"https://surabaya.tribunnews.com/tag/bupati-jombang-warsubi\">Bupati Jombang Warsubi</a>.</div><div><br><br></div>', '[\"data:image\\/jpeg;base64,\\/9j\\/4AAQSkZJRgABAQEAYABgAAD\\\\/4QQZaHR0cDovL25zLmFkb2JlLmNvbS94YXAvMS4wLwA8P3hwYWNrZXQgYmVnaW49J++7vycgaWQ9J1c1TTBNcENlaGlIenJlU3pOVGN6a2M5ZCc\\\\/9sAQwAHBQUGBQQHBgUGCAcHCAoRCwoJCQoVDxAMERgVGhkYFRgXGx4nIRsdJR0XGCIuIiUoKSssKxogLzMvKjInKisq\\/9sAQwEHCAgKCQoUCwsUKhwYHCoqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioqKioq\\/8AAEQgB1gICAwEiAAIRAQMRAf\\/EAB8AAAEFAQEBAQEBAAAAAAAAAAABAgMEBQYHCAkKC\\/\\/EALUQAAIBAwMCBAMFBQQEAAABfQECAwAEEQUSITFBBhNRYQcicRQygZGhCCNCscEVUtHwJDNicoIJChYXGBkaJSYnKCkqNDU2Nzg5OkNERUZHSElKU1RVVldYWVpjZGVmZ2hpanN0dXZ3eHl6g4SFhoeIiYqSk5SVlpeYmZqio6Slpqeoqaqys7S1tre4ubrCw8TFxsfIycrS09TV1tfY2drh4uPk5ebn6Onq8fLz9PX29\\/j5+v\\/EAB8BAAMBAQEBAQEBAQEAAAAAAAABAgMEBQYHCAkKC\\/\\/EALURAAIBAgQEAwQHBQQEAAECdwABAgMRBAUhMQYSQVEHYXETIjKBCBRCkaGxwQkjM1LwFWJy0QoWJDThJfEXGBkaJicoKSo1Njc4OTpDREVGR0hJSlNUVVZXWFlaY2RlZmdoaWpzdHV2d3h5eoKDhIWGh4iJipKTlJWWl5i